    self.drivexyToNB = function (x, y) {
        var dis = Math.sqrt(Math.pow(x - self.x, 2) + Math.pow(y - self.y, 2));
        var angle = Math.atan((y - self.y) / (x - self.x)) / Math.PI * 180;
        if (x - self.x < 0) angle += 180;
        if (angle < 0) angle += 360;
        var deltaAngle = angle - self.angle;
        console.log('hit');
        console.log(deltaAngle);

        var p;
        if (deltaAngle > 180) {
            p = self.turnRightNB(360 - deltaAngle).then(function () {
                return self.cancelable(self.driveDistanceNB(dis));
            });
        } else if (deltaAngle > 0) {
            p = self.turnLeftNB(deltaAngle).then(function () {
                return self.cancelable(self.driveDistanceNB(dis));
            });
        } else if (deltaAngle > -180) {
            p = self.turnRightNB(-deltaAngle).then(function () {
                return self.cancelable(self.driveDistanceNB(dis));
            });
        } else {
            p = self.turnLeftNB(deltaAngle + 360).then(function () {
                return self.cancelable(self.driveDistanceNB(dis));
            });
        }

        return self.cancelable(p);
    };

    self.drivexyTo = function (x, y) {
        var dis = Math.sqrt(Math.pow(x - self.x, 2) + Math.pow(y - self.y, 2));
        var angle = Math.atan((y - self.y) / (x - self.x)) / Math.PI * 180;
        if (x - self.x < 0) angle += 180;
        if (angle < 0) angle += 360;
        var deltaAngle = angle - self.angle;

        var p;
        if (deltaAngle > 180) {
            p = self.turnRight(360 - deltaAngle).then(function () {
                return self.cancelable(self.driveDistance(dis));
            });
        } else if (deltaAngle > 0) {
            p = self.turnLeft(deltaAngle).then(function () {
                return self.cancelable(self.driveDistance(dis));
            });
        } else if (deltaAngle > -180) {
            p = self.turnRight(-deltaAngle).then(function () {
                return self.cancelable(self.driveDistance(dis));
            });
        } else {
            p = self.turnLeft(deltaAngle + 360).then(function () {
                return self.cancelable(self.driveDistance(dis));
            });
        }

        return self.cancelable(p);
    };

