    self._moveGeneric = function (angle1, angle2, angle3, relative1, relative2, relative3, controller1, controller2, controller3, timeout1, timeout2, timeout3, state_on_timeout1, state_on_timeout2, state_on_timeout3, mask, wait_mask) {
        var a1 = deg2rad(angle1);
        var a2 = deg2rad(angle2);
        var a3 = deg2rad(angle3);

        var angles = [a1, a2, a3];
        var relative = [relative1, relative2, relative3];
        var controller = [controller1, controller2, controller3];
        var timeouts = [timeout1, timeout2, timeout3];
        var endStates = [state_on_timeout1, state_on_timeout2, state_on_timeout3];
        var goal_objs = [{}, {}, {}];
        var move_obj = {};

        for (var i = 0; i < 3; i++) {
            goal_objs[i].goal = angles[i];
            if (relative[i]) {
                goal_objs[i].type = self.robot_pb_enums.Goal.Type.RELATIVE;
            } else {
                goal_objs[i].type = self.robot_pb_enums.Goal.Type.ABSOLUTE;
            }
            if (timeouts[i] !== undefined) {
                goal_objs[i].timeout = timeouts[i];
            }
            if (endStates[i] !== undefined) {
                goal_objs[i].modeOnTimeout = endStates[i];
            }
            if (controller[i] !== undefined) {
                goal_objs[i].controller = controller[i];
            }
        }

        if (mask & 0x01) {
            move_obj.motorOneGoal = goal_objs[0];
        }
        if (mask & 0x02) {
            move_obj.motorTwoGoal = goal_objs[1];
        }
        if (mask & 0x04) {
            move_obj.motorThreeGoal = goal_objs[2];
        }

        var p = new Promise(function (resolve, reject) {
            self._jointsMovingMask = mask & self._motorMask;
            util.timeout(self.proxy.robotMove(move_obj, function (err, result) {
                if (err) {
                    reject(err);
                } else {
                    resolve();
                }
            }), ROBOT_TIMEOUT);
        });
        var _p = p.then(function () {
            return self.moveWait(wait_mask);
        });
        return self.cancelable(_p);
    };

